import React from 'react';



function Pictures(props) {
    return (

        <div className='col-md4-4 col-sm-6'>
            <div className='card'>
                style={{ backgroundColor: props.info.website ? 'white' : 'black' }} >
            </div>
            <img src={props.p.img} alt={`Icon of ${props.p.media}`} />
            <p>{props.p.name}</p>
            <p>{props.p.work}</p>
            <p>{props.p.phone}</p>
            <p>{props.p.email}</p>
            <p>{props.p.website}</p>

        </div>
    );
}

export default Pictures;
